import React from "react";
import axios from "axios";
import {
  Checkbox,
  Button,
  Form,
  Select,
  Input,
  TextArea
} from "semantic-ui-react";

function Upload() {
  const options = [
    { key: "w", text: "Website", value: "website" },
    { key: "d", text: "Window Application", value: "window application" },
    { key: "a", text: "Android Application", value: "android application" }
  ];

  return (
    <Form>
      <Form.Group>
        <Form.Field
          fluid
          control={Select}
          label="Project Type"
          options={options}
          placeholder="Project Type"
          width={4}
          margin={3}
        />
        <Form.Field
          fluid
          control={Input}
          label="Title"
          placeholder="title"
          width={4}
        />
      </Form.Group>
      <Form.Group widths="equal">
        <Form.Field
          control={Select}
          options={options}
          label="Language"
          placeholder="title"
        />
        <Form.Field
          control={Select}
          options={options}
          label="Version"
          placeholder="title"
        />
      </Form.Group>
      <Form.Field control={Checkbox} label="check to upload database" />
      <Form.Group>
        <Form.Field
          control={Select}
          label="Database"
          placeholder="title"
          options={options}
          width={4}
        />
        <Form.Field
          control={Select}
          label="Version"
          placeholder="title"
          options={options}
          width={4}
        />
      </Form.Group>
      <Form.Field
        control="input"
        label="Database backup file"
        type="file"
        accept=".sql"
      />
      <Form.Field
        control={TextArea}
        label="About"
        placeholder="Tell us more about you..."
      />
      <Form.Field control={Checkbox} label="allow download" />
      <Button type="submit">Submit</Button>
    </Form>
  );
}

export default Upload;
